    "hook": {
      "on-activate": "\n  # Marry gh cli with fzf...\n  [[ \"$(gh f -V 2>&1)\" =~ \"unknown command\" ]] && gh extension install gennaro-tedesco/gh-f\n\n  navi repo add denisidoro/cheats\n"
    },
    "profile": {
      "common": "  [[ -z $GITHUB_TOKEN ]] && echo \"Set GITHUB_TOKEN before activating to auth gh tooling.\"\n\n  alias cat=bat\n  alias lz=exa\n  alias lx=exa -al\n",
      "bash": "  # Setup fzf shortcuts and tab completion\n  eval \"$(fzf --bash)\"\n",
      "zsh": "  # Setup fzf shortcuts and tab completion\n  eval \"$(fzf --zsh)\"\n"
    },
    "options": {
